  [],\n\t\"revision_timestamp\": \"2015-12-20T21:53:40.533935\",\n\t\"name\": \"2014-noaa-post-hurricane-sandy-topobathymetric-lidar-mapping-for-shoreline-mapping\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These data were collected by the National
  Oceanic Atmospheric Administration National Geodetic Survey Remote Sensing Division
  using a Riegl VQ820G system. The data were acquired from 20140108 - 20140522 in
  four missions. The missions flown on 20140108 and 20140109 represent Low Water missions
  and the missions flown on 20140516 and 20140522 represent High Water (everything
  outside of MLLW tidal requirements) missions. The data includes topobathy data in
  an LAS 1.2 format file classified as unclassified (1), ground (2), topo noise (7),
  refracted High Water data landward of the MLLW land/water interface (18), bathy
  noise (22), noise as defined by the sensor (23), refracted sensor noise (24), water
  column (25), bathymetric bottom or submerged topography (26), water surface (27),
  International Hydrographic Organization (IHO) S-57 objects (30), and temporal bathy
  bottom (31) in accordance with project specifications. Several of the noise classes
  were filtered out prior to distribution on the Digital Coast. The full project consists
  of 2,775 square miles along the Atlantic Coast from New York to South Carolina.
  This dataset represents a contiguous area covering a portion of acquisition block
  1 to 140 with 500 m x 500 m lidar tiles.\",\n\t\"license_title\": null,\n\t\"extras\":
